import { Form, Input, Checkbox, Button } from "antd"
import { LockOutlined, UserOutlined, } from '@ant-design/icons';
import "./LoginRegister.scss"
import Footer from "../components/component-recycle/Footer";
import Header from "../components/component-recycle/Header";
import { Link } from "react-router-dom";


function LoginRegister() {
    const onFinishLogin = (values) => {
        console.log('Received values of form: ', values);
    };
    const onFinishRegister = (values) => {
        console.log('Received values of form: ', values);
    };
    return (
        <>
            <Header />

            <div className="centerLogin">
                <div className="part-centrer">

                </div>



                <div className="part-centrer">
                <div className="register box">

<Form
    layout="vertical "


    className="register form"
    initialValues={{
        remember: true,
    }}
    onFinish={onFinishRegister}>
    <h1>Register</h1>
    <p>Don't have an account yet? Register here!</p><br />
    <Form.Item
        label="Email"
        name="email"
        rules={[
            {
                required: true,
                message: 'Please input your Email!',
            },
            { type: "email" }
        ]}
    >
        <Input className="input" prefix={<UserOutlined className="site-form-item-icon" />} placeholder="Email" />
    </Form.Item>
    <Form.Item
        label="Passord"
        name="password"
        rules={[
            {
                required: true,
                message: 'Please input your Password!',
            },
            { min: 6 }
        ]}
    >
        <Input.Password
            className="input"
            prefix={<LockOutlined className="site-form-item-icon" />}
            type="password"
            placeholder="Password"

        />
    </Form.Item>
    <Form.Item
        label="Confirm passord"
        name="confirmPassword"
        rules={[
            {
                required: true,
                message: 'Please input your Password!',
            },
            { min: 6 },
            ({ getFieldValue }) => ({
                validator(_, value) {
                    if (!value || getFieldValue("password") === value) {
                        return Promise.resolve()
                    }
                    return Promise.reject('Confirm password doesnÂ´t match')
                }
            })
        ]}
    >
        <Input.Password
            className="input"
            prefix={<LockOutlined className="site-form-item-icon" />}
            type="password"
            placeholder="Confirm Password"

        />
    </Form.Item>
    <Form.Item>

        <Form.Item>
            <Button type="primary" htmlType="submit" className="login-form-button">
                Register
            </Button>
        </Form.Item>
    </Form.Item>
</Form>
</div>
                    </div>

            </div>

            <Footer />
        </>);
}

export default LoginRegister;
